INSERT INTO `art_content` VALUES ('114411','介绍:二零一三年，随着一款电子竞技类游戏在全球正式发布之后，全世界网络会所电脑屏幕上的图像一夜之间变得空前的整洁、一致。从此，步入网络会所，你便来到了召唤师峡谷。','114411'),('117784','介绍:远东大地风雷动，赎罪城外血雨飘；兽人军团杀孽重，奈落教徒罪恶昭。','117784'),('132544','介绍:二十二纪世界末日，拥有空间和木系双系异能的林心兰被男友闺蜜双双背叛，被他们下药之后送到基地实验研究所，只为换取一个月的粮食。','132544'),('133908','介绍:井上文英对着三代火影道：有没有一种威力超级大但是耗费查克拉很少的忍术，三代火影微笑的回道：这种忍术我们木叶正在研发，等研发出来一定告诉你。哪有没有一种药吃了可以拥有无尽的查克拉。三代火影沉思了一下，嗯这种要全忍界都在寻找。到现在都没有找到。希望文英你能找到。哪三代火影怎么才能变强啊？三代火影微笑道：只要你够努力一定可以变强的','133908'),('134420','介绍:公元2051年，地球人口突破100亿，饥饿成为人类面临的首要难题；若干年后，人类又发现一个更严重的问题摆在了面前，那就是能源危机。月球上的氦3资源再一次成为各国争夺的热点；……为解决由月球资源引发的能源争端，《月球战争：MOONWARS》应运而生，月球矿产资源的获取与分配将以此为媒介，以虚拟实境游戏的方式来实现对现实月球矿产资源的开采、售卖甚至掠夺。主角幸运的获得了公测头盔，在游戏中一步步耕耘与收获。','134420'),('135007','介绍:你有没有想过，NPC们是怎样看待自己的世界？哪怕所经历的一切都是设定好的数据，哪怕只要屏幕外的程序员错打一个字符，结果便大不相同。对他们而言，游戏中的世界真的算虚构吗？如果……我们的世界也是一样呢……也许只是我们并未意识到罢了。++++++++++++++++++++++++++虽说叫勇敢者的世界，但其实没有任何恐怖元素，请放心阅读。——有节操的作者上。真的，有节操_(:з」∠)_','135007'),('135428','介绍:某宅男舰娘关闭服务器，转战其他网页游戏第一舰队在游戏过程中意外穿越，发现竟然是个舰娘与第一舰队融合的世界，于是悲剧开始了，平凡的他如何在这个以战争为主旋律的世界生存','135428'),('136407','介绍:【最爽热书】会透视后，一切都变了！','136407'),('136867','介绍:轮回空间扩大业务，诚向各位面招收主神代理，一经录取，即可享受其他轮回者无法享受的优质待遇。本轮回空间，本着公平、公正、公开的原则，决不允许轮回者在轮回世界里胡闹，努力做到轮回者土著一家亲……身为主神代理，管理轮回世界，创建爱与和平的轮回空间，是刻不容缓的职责与义务！主神代理苏景：自从上了你的贼船，我就知道我这辈子是下不去了！已有六百万字超长精品巨著《无限之配角的逆袭》，从未断更，人品保证！！！','136867'),('136952','介绍:在一间不起眼的直播间，一个半吊子的修仙者正在直播修仙。现学现卖，边教边学，课程颇多，八百一十门。灵地学吐纳，荒野采灵药，海中斗妖兽，闹市炼符箓，灵火炼仙丹，云峰御飞剑……至于教的效果怎么样，直播间的观众纷纷表示，有没有一起组队修仙的。PS:历史流修仙，以史书为骨，以幻想为肉，构建新神话。','136952'),('137860','介绍:“干什么来了?”“找工作。”“想找哪一类的?财务、人事、劳力、运输……”“都不会。”“那你想做什么?”“足球教练！”“哈！那我们可没辙，你得指望神仙了。”“也行，那给开封介绍信呗!”','137860'),('137943','介绍:风云大陆，宗派林立，强者如云，云之大陆的宇文家，经过百年的发展，成为云之大陆的顶级势力之一，时过境迁，百年转眼即过，宇文家本可以继续朝前迈开步伐，奈何两代家主相继离世，第三代少主宇文浩竟是天生废脉，宇文家将面临怎样的抉择和挑战呢？宇文浩：“宇文家少主身份？我毫无在乎，既然你们把我当成家族弃子，不知你们嘴中这个所谓的弃子名动大陆的那一天，你们会是什么表情呢？”宇文浩：“今日你们给我的屈辱，来日我必将十倍百倍奉还！”','137943'),('139253','介绍:现实数据流，主角穿越到百年之后的地球，发现地球已经进入数据化的灵能时代，遭遇灵界怪物入侵。主角依靠进化之眼带来的能力，踏上灵能时代的巅峰。','139253'),('139779','介绍:“安林真神，嫦娥仙子特意为您做了一盒月饼，托小的送给您。”一名小仙恭敬地说道。“嗯，先在这里放着吧。”安林眼睛也不抬一下，仍是专心地看着一本古籍。“安林真神，七仙女中的天羽仙女嘱托小仙给您送花来了。”这时又有一名仙女拿着花篮踏门而入，俏脸微红，却是恭敬地说道。“唉，我都说不喜欢她了，她怎么还没对我死心。”安林无奈。就在这时，战神系统出现了提示“把花吃了。”安林肃然点头，拿起花篮内的花，当着众人的面吃了起来……','139779'),('139975','介绍:少年苏庭，携陆压传承，穿越仙侠神话世界。炼就斩仙飞刀，成就雷火之体。上震云霄，下慑幽冥。诸天神仙，无敢犯者。“我有一刀，诸天万界，神仙妖魔，无有不惧者！”','139975'),('140477','介绍:一个来自地狱的包裹，一封诡异古怪的邮票，恭喜你成为一名新的邮差，请签收包裹，来体验下死亡的旅途吧。邮差终有一死，唯有邮票长存。———————————————————————————————过水群号：262521930车牌号：KBCP9286','140477'),('142630','介绍:雇佣兵王陈扬回归都市，只为保护战友的女神妹妹。无意中得罪少林俗家弟子这个恐怖的集团。一时间风起云涌，杀机如流。','142630'),('142776','介绍:一次意外让黄昊获得了无上仙瞳与医仙传承，不但拥有了透视的能力，还拥有无敌的医术。从此，清纯大学生、可爱小萝莉、御姐俏女警、温柔美护士……群芳环绕，应有尽有。','142776'),('142993','介绍:万千大世界，强者如林。','142993'),('143014','介绍:高冷总裁为他折腰，性感女神为他心动，强势警花为他温柔，清纯校花为他妩媚。他是战场的死神，有着显赫的家世，看着诸多美女，面带邪笑：“弱水三千，我一瓢也不放过。”','143014'),('143068','介绍:穿越之后，叶轩偶得吞噬系统，不仅可以吞噬万物，还可兑换血脉、武学、神兵、丹药、宝物……这简直是强到爆了！“别惹我，信不信我把你的神器宝剑吞了？”','143068'),('143130','介绍:一场大病导致高考落榜，上天关掉了叶凡的一扇门，却又为他打开了一扇窗，得到了伏羲真传，从此治病疗伤信手拈来，发财致富不在话下，最重要的，那些大小美女饿狼扑食一般冲过来，让他烦不胜烦……','143130'),('143224','介绍:大明天启三年，大太监魏忠贤把持朝政，东林党人和魏忠贤针锋相对势不两立。而我则变成了魏忠贤的侄孙……','143224'),('143253','介绍:穿越异世后，我发誓，要修最强的神通，睡最美的女人，九天十地，唯我独尊！为所欲为，谁能阻挡我逍遥之路！','143253'),('144382','介绍:带着一纸婚约，夏天宇进入了大学校园。他的18岁校花未婚妻刁蛮任性，身边还跟着一个有胸无脑的呆萌妹子，想要搞定两人真的很需要费一番功夫！更何况，都市的灯红酒绿之中隐藏着滚滚暗流，千娇百媚的红颜心中涌动着无限柔情，这对王牌杀手夏天宇来说，真是一番考验！','144382'),('146623','介绍:眼见为实么？耳听为真么？让她恨极了的，是仇人么？历经两世，阿夏姑娘小心谨慎、步步为营，可那几个甩不脱踹不开的公子哥儿，是怎么回事？…………你！欠我的，必须还！','146623'),('152024','介绍:回乡小农民无意得神农咒语，开始了自己强悍的人生。青山绿水，他要打造一片人间乐土。钱要有，美女更要有！村花校花、人妻少妇……等等，我今晚该在哪个房间睡？','152024'),('152295','介绍:人死后皆为鬼，动物死后皆为灵。人们驯养动物为宠物，宠物死后何去何从？灵宠，即以死去动物阴灵驯化而成的宠物。白话经营着一家只在午夜营业的灵宠宠物店，生意火爆，日进斗金。','152295'),('156849','介绍:一个没有系统，没有金手指的家伙穿越到DC哥谭的世界，很不幸还背负前任留下巨额债务。','156849'),('157692','介绍:简介1：','157692'),('159197','介绍:“新店开张，大甩卖啊，大甩卖！”','159197'),('162767','介绍:大学毕业三年依旧在家啃老的猪脚意外获得系统奇遇，在山水之间活出精彩的农村生活。','162767'),('164704','介绍:这个世界是有鬼的，也有神。但神……都死了？！','164704'),('166050','介绍:无所达致，自然而然，自在自适，不假他求，不须外物，自我圆满。此谓之——大自在！','166050'),('166103','介绍:【电竞言情】青梅竹马年少欢喜。大学毕业，舒心从文科学霸变身顶尖俱乐部ZK战队随行医生，季诚早已成为ZK战队队长。因误会生疏，又因缘分重聚。少年时期，季诚就被舒心摁的死死的。没曾想再次遇见，只要舒心一句“今天你敢动鼠标试试”就乖乖束手就擒。ZK队员表示：队长，你的画风不对啊？！','166103'),('167381','介绍:对于曾在战争中厮杀过的人来说，战争永远不会结束。但萧远的战争才刚刚开始……一场已经结束的战争。古德里安？隆美尔？曼施坦因？苏联只需要一个小兵……舒尔卡','167381'),('167980','介绍:菩提树下，白衣飘飘，一次仙宴，成就了他与她的初见。双眸对视，成就了他与她的情心暗许。她是天帝长女，修道奇才，注定执掌六界，断情绝爱，渡万物，化众生，却因出身而流落红尘，为大邺国师。他本是玉漱宫掌门，霜剑风华，举无世双，今天下女仙心驰神往，却在机缘巧合之下剃度出家。一番纠缠后，抛去蕙质兰心，方知:菩提本无树，明镜亦非台，本来无一物，何处惹尘埃。','167980'),('47670','介绍:乾坤剑神最新章节列：小说《乾坤剑神》尘山/著,乾坤剑神全文阅读关于乾坤剑神：','47670'),('4818','介绍:一个大山里走出来的绝世高手，一块能预知未来的神秘玉佩……林逸是一名普通学生，不过，他还身负另外一个重任，那就是追校花！而且还是奉校花老爸之命！虽然林逸很不想跟这位难伺候的大小姐打交道，但是长辈之命难违抗，他不得不千里迢迢的转学到了松山市，给大小姐鞍前马后的当跟班……于是，史上最牛B的跟班出现了——大小姐的贴身高手！看这位跟班如何发家致富偷小姐，开始他奉旨泡妞牛X闪闪的人生……本书有点儿纯……也有点儿小暧昧……【本书目前不求月票了，各位如果觉得书还不错，就投一些推荐票吧！】','4818'),('84372','介绍:穿越就穿越，为什么又让她喜欢上别人！','84372');
